import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-q5',
  templateUrl: './q5.component.html',
  styleUrls: ['./q5.component.css']
})
export class Q5Component implements OnInit{
  GamesByStudios: GamesByStudio[] = [];

  constructor(
    private leaderboardService: LeaderboardService,
  ) { }

  ngOnInit(): void {
    this.leaderboardService.getGamesByStudio()
      .subscribe(GamesByStudios => this.GamesByStudios = GamesByStudios);
  }
}
